import React, { Component } from "react";
import { Navbar, Nav, NavItem ,Form,FormControl,Button} from "react-bootstrap";
import { Link } from "react-router-dom";
class navbar extends Component {
  render() {
    return (
        <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">GitHub</Navbar.Brand>
     <Nav className="mr-auto">
      <input class="form-control " type="search" placeholder="Search" aria-label="Search"></input>
      <button class="m-2  btn-secondary" type="submit">Search</button>
      <Nav.Link href="/" className=" m-2  btn-secondary">Home</Nav.Link>
      <Nav.Link href="news"  className=" m-2  btn-secondary">News</Nav.Link>
      <Nav.Link href="about"  className="m-2  btn-secondary">About</Nav.Link>
    </Nav>
  </Navbar>
    );
  }
}

export default navbar;
